import React from "react";
import Styled from "styled-components";

const Header = Styled.header`

`;

const List = Styled.ul`
    display: flex;
    &:hover {
        background-color: blue;
    }
`;

export default () => (
    <header>
        <List>
            <ul>
                <li>
                    <a href="/">Movies</a>
                </li>
                <li>
                    <a href="/tv">TV</a>
                </li>
                <li>
                    <a href="/search">Search</a>
                </li>
            </ul>
        </List>
    </header>
);
